import { Types } from "../constants/actionTypes";

const initialState = {
  profile: {
    name: "",
    userName: "",
    email: "",
    mobile: "",
    city: "",
    password: "",
    confirmPassword: "",
  },
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case Types.REGISTER_USER:
     let data2 = action.payload
     console.log("djhfj===>", data2);
      return {
        ...state,
        profile: data2,
      };
    default:
      return state;
  }
};

export default reducer;
